const adminRescue = async () => {
  const bad = "0x8Dfc57c1c1032e08f3DF6C71A6d8b8EF88a7aC21";
  const { contract } = await getContractAndData("CosmicWizards", hre);
  const rawIds: BigNumber[] = await contract.tokensOfOwner(bad);
  const ids = rawIds.map(i => i.toNumber());
  const participationData = harmonyData;
  const toRescue: { [address: string]: number[] } = {};
  for (let i = 0; i < participationData[1].length; i++) {
    const nfts: NFT[] = participationData[1][i].map((n: any) => ({ _address: n[0], tokenId: BigNumber.from(n[1]), rewardFrom: BigNumber.from(n[2]) }));
    nfts.map(n => {
      if (ids.includes(n.tokenId.toNumber())) {
        const w = participationData[0][i];
        if (!(w in toRescue)) {
          toRescue[w] = []
        }
        toRescue[w].push(n.tokenId.toNumber());
      }
    })
  }


  const accounts: string[] = [];
  const tokenIds: number[] = [];

  Object.entries(toRescue).map(([account, tIds]) => {
    tIds.map(t => {
      accounts.push(account)
      tokenIds.push(t)
    })
  })
  console.log(JSON.stringify(toRescue))
  console.log("Total Wallets:", Object.keys(toRescue).length)
  const batchCount = 75;
  const batches = Math.ceil(accounts.length / batchCount);
  for (let i = 0; i < batches; i++) {
    const begin = i * batchCount;
    const end = begin + batchCount;
    console.log("Sending batch", i, "with ids", begin, "through", end, "of", batches-1, "batches");
    const tx = await contract.adminRescue(bad, accounts.slice(begin, end), tokenIds.slice(begin, end))
    await tx.wait();
  }
}

